import React from 'react';

const Menu = () => {
  return (
    <section className='menu'>
      <div className='Jon'></div>
      <div className='menuText'>
        <h1>agents</h1>
        <h2>PROTECTING WHAT'S MOST IMPORTANT</h2>
        <div className='round'>
          <p>
            We’ve served generations. Protecting what’s most important. Let us
            do the same for you.
          </p>
          <span>read more</span>
        </div>
      </div>
    </section>
  );
};

export default Menu;
